import React from "react";
import { useEffect } from "react";
import { useState } from "react";

const App = () => {
  const [num, setNum] = useState(1);
  useEffect(()=>{
    document.title=`you clicked me ${num}`;
  })



  return (
    <button
      onClick={() => {
        setNum(num + 1);
      }}
    >
      Click me {num}
    </button>
  );
};

export default App;
